import ClassSearchBar from "./components/ClassSearchBar";

import './App.css';
import React from "react";

function App() {
  return (
      <body>
        <div>
          <ReactCalendar/>
        </div>
        <div>
          <ClassSearchBar/>
        </div>
      </body>
  );
}

export default App;
